Mia Loves Girls (Split Scenes)
~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~

Synopsis: Sweetheart Video proudly presents &quot;Mia Loves Girls&quot; - the latest star showcase in its top selling series. Best new starlet Mia Malkova undulates her way through four heart-stopping, sensual scenes with four beauties of her choice: Whitney Westgate, Kenna James, Bree Daniels and Aubrey Star. Enjoy her candid interviews, and see why this stunner is an enormous favorite amongst fans and co-stars alike!

Cast: Mia Malkova, Whitney Westgate, Bree Daniels, Kenna James (II), Aubrey Star, Dana Vespoli,Director

